package main

import (
	"github.com/stretchr/testify/assert"
	"testing"
)

func TestSFU(t *testing.T){
	sfu, err := NewSFUServer("172.172.172.172", 8888)
	assert.Nil(t, err)
	assert.NotNil(t, sfu)
	sdp, err := sfu.NewPublish("0", "")
	assert.Nil(t, err)
	assert.NotEqual(t, "", sdp)


	sdp, err = sfu.NewPlay("0", "")
	assert.Nil(t, err)
	assert.NotEqual(t,  "", sdp)
}
